import Navbar from 'react-bootstrap/Navbar';

import './topbar.css';
import TopBarLogo from './logo_hanshin.svg';

const TopBar = () => {
  return <div className='navBarContainer'>
    <Navbar>
      <Navbar.Brand href='' className='navBarLogoContainer'>
        <img src={TopBarLogo}/>
      </Navbar.Brand>
    </Navbar>
  </div>;
}

export { TopBar };
